function Tabel() {
    return (
    <div className="App">

    <h1>Menu Page</h1>
        <div>
            {menus.map((data)=>(
                <li key={data.idmenu}>{data.menu} Rp {data.harga}</li>
            ))}
        </div>
    </div>
    );
    }

export default Tabel;
